import React from "react";
import Row from "./Row/Row";

const App = () => {
  return (
    <div className="container">
      <h1>BINGO!</h1>
      <div className="bingoBoard">
        <Row />
        <Row />
        <FreeSpaceRow />
        <Row />
        <Row />
      </div>
    </div>
  );
};

export default App;
